package com.google.tendengce.entity;import java.util.Date;public class Info {    private int id;    private String infomation;    private String validFlag;    private Date createDate;    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getInfomation() {        return infomation;    }    public void setInfomation(String infomation) {        this.infomation = infomation;    }    public String getValidFlag() {        return validFlag;    }    public void setValidFlag(String validFlag) {        this.validFlag = validFlag;    }    public Date getCreateDate() {        return createDate;    }    public void setCreateDate(Date createDate) {        this.createDate = createDate;    }}